import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app">
      <div className="header">
        <input className="search-input" type="text" />
      </div>
      <div className="content df fd-c">
        <div>Yesterday</div>
        <div>Today</div>
        <div>Tomorrow</div>
      </div>
    </div>
  );
}

export default App;
